import React from 'react';
import logo from './logo.svg';
import iphone from './ressources/iphonex.png';
import arrowLeft from './ressources/arrow-left-circle.svg';
import arrowRight from './ressources/arrow-right-circle.svg';

import './App.css';
import Navbar from './Navbar';



export default class ProductPage extends React.Component{

    fonksiyon = () => {
        console.log("a")
    }

    render(){
        return(
            <div>
                <div><Navbar/></div>
                <div id="frame">
                    <div class="border border-2 rounded-1" id="photo-frame">
                        <div>
                            <img src={arrowLeft} id="arrow-circle" onClick={this.fonksiyon()}></img>
                            <img src={iphone} id="photo"></img>
                            <img src={arrowRight} id="arrow-circle"></img>
                        </div>
                        <div>
                            <p>A very great mobile phone.</p>
                        </div>
                    </div>
                    <div class="border border-2 rounded-1" id="photo-frame2"></div>
                </div>
            </div>
        )
    }
}
